INSERT INTO `pay_article` VALUES ('16', '3', '0', '客户告知书', '<p></p><p>尊敬的商户朋友：  </p><p>           <br /></p><p>    本公司是一家正规的网络公司，是各大游戏充值卡发卡商，电商平台等中小型企业长期的合作伙伴；</p><p><br /></p><p>      本公司郑重告知，请各客户加强业务自审勿与违法违规的业务发生关联，比如涉黄、涉赌、涉及网络诈骗等；我公司一经发现有涉及违法违规的业务，我公司将把相关信息上报公安机关派驻我公司的网安警务室处理。        </p><p><br /></p><p style=\"text-align:right;\">请合作的客户知晓并认真审查业务 特此告知！  </p><p><br /></p><p><br /></p><p><br /></p><p><br /></p><p></p><p style=\"text-align:right;\">                                                                                                                              <br />                                                                                                                2018/1/12 8:41:07</p>', '1515717667', '', '1', '1537723684');
INSERT INTO `pay_article` VALUES ('20', '6', '2', '支付宝转账免签通道配置说明', '<p>监控软件下载地址：</p><p>百度盘：https://pan.baidu.com/s/1XU7N0nSuGC75z13cMQZYdg 提取码：vbke</p><p>后台添加账号教程：</p><p>添加子账号的地方 名称 填写支付宝账号（邮箱或者手机号）</p><p>APPID 填写 支付宝的PID</p><p><img src=\"./Uploads/Article/20190414/5cb215595bf20.png\" alt=\"undefined\" /><br /></p><p><br /></p><p>监控配置</p><p>商户id 填写您在本平台的商户id</p><p>加密key 固定填写 1531236</p><p><img src=\"./Uploads/Article/20190404/5ca587d602c97.png\" alt=\"undefined\" /><br /></p>', '1554351369', '支付宝转账免签通道配置说明', '1', '1555174749');
INSERT INTO `pay_article` VALUES ('21', '6', '2', '淘宝红包（旺信群）免签通道配置说明', '<p>监控APP下载：</p><p>百度盘：https://pan.baidu.com/s/1kxEx2eqqsoqU4yyAynwrcQ 提取码：7huu</p><p>旺信红包使用教程：</p><p>---准备工作，俩个号拉个群（装监控的号不能当群主）</p><p><br /></p><p>先打开钱嘟嘟，点击启动，然后打开旺信，进入你拉的俩人群页面，再返回钱嘟嘟，可以看到旺信HOOK成功，再返回旺信群页面</p><p><br /></p><p>后台账号添加配置：</p><p><img src=\"./Uploads/Article/20190407/5ca96a4ead7b7.png\" alt=\"undefined\" /><br /></p><p><br /></p><p><br /></p>', '1554605867', '', '1', '1554606675');
INSERT INTO `pay_article` VALUES ('22', '6', '2', '支付宝转银行卡免签通道配置说明', '<p>监控APP下载</p><p>百度盘：https://pan.baidu.com/s/1t7cTLIx59I8jUfNeNjYXOg  提取码：3z6j</p><p>安装说明：</p><p>直接安装到手机即可，不需要xp</p><p><br /></p><p>后台上号配置：</p><p><img src=\"./Uploads/Article/20190407/5ca975203e9da.png\" alt=\"undefined\" /><br /></p>', '1554048000', '支付宝转银行卡免签通道配置说明', '1', '1554609445');
INSERT INTO `pay_article` VALUES ('23', '6', '2', '钉钉群收款免签通道配置说明', '<p>钉钉群收款</p><p>监控APP下载地址：</p><p>百度云：https://pan.baidu.com/s/1rIssD_Q8DASiLwOGpbov5A  提取码：gqc7</p><p>----准备工作。两个号拉个群（记得绑支付宝） 拉群可用面对面建群（俩人输入相同的4位数字即可建群） 注意 A B 两号 不能参加多群 只能有一个群 最好~</p><p>打开钉钉助手，点击启动，然后打开钉钉软件，进入一下钉钉创建的群聊界面，返回钉钉助手</p><p>可以看的您的钉钉账号ID 和群的ID 入下图，记录下备用。</p><p><img src=\"./Uploads/Article/20190408/5cab5e50c5c5d.png\" alt=\"undefined\" /><br /></p><p>打开程序配置：吧自己当前的钉钉UID 填写进去 点击保存返回</p><p><img src=\"./Uploads/Article/20190408/5cab5e8b43b0c.png\" alt=\"undefined\" /><br /></p><p><br /></p><p>重要： 重启xposed</p><p>重要： 重启xposed</p><p>重要： 重启xposed</p><p>然后 打开钉钉助手，点击启动，打开钉钉 进去群聊界面</p><p>返回钉钉助手，可以入上面第一张图一样</p><p>到此监控端配置完毕</p><p><br /></p><p>后台添加账号设置图</p><p><img src=\"./Uploads/Article/20190408/5cab5fea16a52.png\" alt=\"undefined\" /><br /></p><p><br /></p>', '1554733824', '钉钉群红包免签通道配置说明', '1', '1554735133');
INSERT INTO `pay_article` VALUES ('24', '6', '2', '新双跳转卡模式配置说明', '<p>最新双跳支付宝转银行卡配置</p><p>监控APP下载</p><p>百度盘：https://pan.baidu.com/s/1Y2RKQOtVetBMrFE3BmtTtg  提取码：5hwt</p><p>安装说明：直接安装到手机即可，不需要xp</p><p>后台上号配置：</p><p><img src=\"./Uploads/Article/20190413/5cb189d7be9bd.png\" alt=\"undefined\" /><br /></p>', '1555138581', '', '1', '1555150518');
INSERT INTO `pay_article` VALUES ('25', '6', '2', '微信店员通免签通道配置说明', '<p>监控下载：</p><p>百度盘：https://pan.baidu.com/s/1A1m5b4X7YrV7K45vgKTOkQ  提取码：i6aw</p><p>操作前提 负责监控的微信号当店员，可以监控最多30个店长的收款数据(可调整数量 5 10都行，号不多，可适当调小）</p><p>店长是用小程序 收款小账本 添加店员（装监控的微信号）,让用户付款给店长的收款二维码，店员即可收到通知并回调。</p><p>保存下来自己的收款二维码，用二维码解码工具转换成链接！</p><p>后台添加账号配置：</p><p><img src=\"./Uploads/Article/20190413/5cb1c5435b2a9.png\" alt=\"undefined\" /><br /></p><p>添加完账号之后，记录下该账号的ID</p><p>如下图中的ID</p><p><img src=\"./Uploads/Article/20190413/5cb1c5a4bf23e.png\" alt=\"undefined\" /><br /></p><p>然后你的收款账号的昵称需要修改为</p><p>这个ID-  的格式  例如   304-钱嘟嘟</p><p>改为自己的微信昵称</p>', '1555153417', '', '1', '1555154421');
